import axios from 'axios'

const CafeReviews = () => {
  const [cafe,setCafe] = useState([])

  useEffect(() => {
    axios.get('/api/cafes/:id')
    .then(cafe => {
        setCafe()
    })
  },[])
  return <div>This is the cafe review list</div>;
}

export default CafeReviews
